INSERT INTO `vtiger_emailtemplates` (`foldername`, `templatename`, `templatepath`, `subject`, `description`, `body`, `deleted`, `templateid`, `systemtemplate`, `module`) VALUES
('Public', 'Announcement for Release', '', 'Announcement for Release', 'Announcement of a release', '<html>\r\n<head>\r\n	<title></title>\r\n	\r\n	\r\n</head>\r\n<body>Hello!<br />\r\n<br />\r\nOn behalf of the&nbsp;Right Choice team, I am pleased to announce the release of right crm. This is a feature packed release including the mass email template handling, custom view feature, rightchoice_reports feature and a host of other utilities. Right choice runs on all platforms.<br />\r\n<br />\r\nNotable Features of vtiger are :<br />\r\n<br />\r\n-Email Client Integration<br />\r\n-Trouble Ticket Integration<br />\r\n-Invoice Management Integration<br />\r\n-Reports Integration<br />\r\n-Portal Integration<br />\r\n-Enhanced Word Plugin Support<br />\r\n-Custom View Integration<br />\r\n<br />\r\nKnown Issues:<br />\r\n-ABCD<br />\r\n-EFGH<br />\r\n-IJKL<br />\r\n-MNOP<br />\r\n-QRST</body>\r\n</html>\r\n', 0, 1, 0, 'Contacts'),
('Public', 'Pending Invoices', '', 'Invoices Pending', 'Payment Due', 'name <br />\nstreet, <br />\ncity, <br />\nstate, <br />\n zip) <br />\n  <br />\n Dear <br />\n <br />\n Please check the following invoices that are yet to be paid by you: <br />\n <br />\n No. Date      Amount <br />\n 1   1/1/01    $4000 <br />\n 2   2/2//01   $5000 <br />\n 3   3/3/01    $10000 <br />\n 4   7/4/01    $23560 <br />\n <br />\n Kindly let us know if there are any issues that you feel are pending to be discussed. <br />\n We will be more than happy to give you a call. <br />\n We would like to continue our business with you.', 0, 2, 0, 'Contacts'),
('Public', 'Acceptance Proposal', '', 'Acceptance Proposal', 'Acceptance of Proposal', ' Dear <br />\n <br />\nYour proposal on the project XYZW has been reviewed by us <br />\nand is acceptable in its entirety. <br />\n <br />\nWe are eagerly looking forward to this project <br />\nand are pleased about having the opportunity to work <br />\ntogether. We look forward to a long standing relationship <br />\nwith your esteemed firm. <br />\n<br />\nI would like to take this opportunity to invite you <br />\nto a game of golf on Wednesday morning 9am at the <br />\nCuff Links Ground. We will be waiting for you in the <br />\nExecutive Lounge. <br />\n<br />\nLooking forward to seeing you there.', 0, 3, 0, 'Contacts'),
('Public', 'Goods received acknowledgement', '', 'Goods received acknowledgement', 'Acknowledged Receipt of Goods', ' The undersigned hereby acknowledges receipt and delivery of the goods. <br />\nThe undersigned will release the payment subject to the goods being discovered not satisfactory. <br />\n<br />\nSigned under seal this <date>', 0, 4, 0, 'Contacts'),
('Public', 'Accept Order', '', 'Accept Order', 'Acknowledgement/Acceptance of Order', '<html>\r\n<head>\r\n	<title></title>\r\n	\r\n	\r\n	\r\n	\r\n</head>\r\n<body>Dear<br />\r\nWe are in receipt of your order as contained in the<br />\r\npurchase order form.We consider this to be final and binding on both sides.<br />\r\nIf there be any exceptions noted, we shall consider them<br />\r\nonly if the objection is received within ten days of receipt of<br />\r\nthis notice.<br />\r\n<br />\r\nThank you&nbsp;</body>\r\n</html>\r\n', 0, 5, 0, 'Contacts'),
('Public', 'Address Change', '', 'Change of Address', 'Address Change', '<html>\r\n<head>\r\n	<title></title>\r\n	\r\n	\r\n	\r\n	\r\n</head>\r\n<body>Dear<br />\r\n<br />\r\n<br />\r\nWe hope to keep in touch with you all.<br />\r\nPlease update your addressbooks.</body>\r\n</html>\r\n', 0, 6, 0, 'Contacts'),
('Public', 'Follow Up', '', 'Follow Up', 'Follow Up of meeting', 'Dear <br />\n<br />\nThank you for extending us the opportunity to meet with <br />\nyou and members of your staff. <br />\n<br />\nI know that John Doe serviced your account <br />\nfor many years and made many friends at your firm. He has personally <br />\ndiscussed with me the deep relationship that he had with your firm. <br />\nWhile his presence will be missed, I can promise that we will <br />\ncontinue to provide the fine service that was accorded by <br />\nJohn to your firm. <br />\n<br />\nI was genuinely touched to receive such fine hospitality. <br />\n<br />\nThank you once again.', 0, 7, 0, 'Contacts'),
('Public', 'Target Crossed!', '', 'Target Crossed!', 'Fantastic Sales Spree!', 'Congratulations! <br />\n<br />\nThe numbers are in and I am proud to inform you that our <br />\ntotal sales for the previous quarter <br />\namounts to $100,000,00.00!. This is the first time <br />\nwe have exceeded the target by almost 30%. <br />\nWe have also beat the previous quarter record by a <br />\nwhopping 75%! <br />\n<br />\nLet us meet at Smoking Joe for a drink in the evening! <br />\n\nC you all there guys!', 0, 8, 0, 'Contacts'),
('Public', 'Thanks Note', '', 'Thanks Note', 'Note of thanks', 'Dear <br />\n<br />\nThank you for your confidence in our ability to serve you. <br />\nWe are glad to be given the chance to serve you.I look <br />\nforward to establishing a long term partnership with you. <br />\nConsider me as a friend. <br />\nShould any need arise,please do give us a call.', 0, 9, 0, 'Contacts'),
('Public', 'Customer Login Details', '', 'Customer Portal Login Details', 'Send Portal login details to customer', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\">\r\n<html>\r\n<head>\r\n	<title></title>\r\n	\r\n	\r\n</head>\r\n<body class=\"scayt-enabled\"><!-- <center> -->\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"borderGrey\" style=\"margin-left:0px;\" width=\"600px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"6\"><!-- Begin Pre header --><!-- // End Pre header \\ --></td>\r\n		</tr>\r\n		<tr style=\"height:50px;\">\r\n			<td colspan=\"6\" style=\"\r\n                  font-family: Helvetica,Verdana,sans-serif\">\r\n			<div style=\"margin-bottom:10px;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><br />\r\n			Dear $contacts-firstname$ $contacts-lastname$,</div>\r\n\r\n			<div style=\"margin-top:20px;margin-bottom:20px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">As our customer, you can be assured of getting excellent support from our team. I would like to take this opportunity to introduce the portal we have setup for valuable customers like you. You can submit questions/issues via the portal, see past issues and responses. In addition, Portal provides you access to our knowledge base and documents we shared with you in the past.</div>\r\n\r\n			<div style=\"margin-top:10px;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">$URL$ to login to the portal, with the credentials below.</div>\r\n\r\n			<div style=\"margin-top:20px;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Your Username: $login_name$</div>\r\n\r\n			<div style=\"margin-bottom:20px;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Your Password: $password$</div>\r\n\r\n			<div class=\"gmail_extra\" style=\"margin-top:10px;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Thank you,<br />\r\n			$contacts-smownerid$</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"6\" style=\"font-family: Helvetica,Verdana,sans-serif;font-size: 11px;color: #666666;\">\r\n			<table border=\"0\" cellpadding=\"4\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody><!--copy right data-->\r\n					<tr>\r\n						<td style=\"\r\n                            padding-left: 0px;\r\n                            padding-right: 0px;\r\n                            width:350px\" valign=\"top\">\r\n						<div style=\"margin-top:20px;\"><em>Powered By : rightchoice.io</em>\r\n						<div></div>\r\n						</div>\r\n						</td>\r\n					</tr>\r\n					<!--subscribers links-->\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<!-- </center> --></body>\r\n</html>\r\n', 0, 10, 0, 'Contacts'),
('Public', 'Support end notification before a week', '', 'Right CRM Support Notification', 'Send Notification mail to customer before a week of support end date', '<html>\r\n<head>\r\n	<title></title>\r\n	\r\n	\r\n</head>\r\n<body>\r\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"font-family: Arial,Helvetica,sans-serif; font-size: 12px; font-weight: normal; text-decoration: none; background-color: rgb(122, 122, 254);\" width=\"700\">\r\n	<tbody>\r\n		<tr>\r\n			<td></td>\r\n			<td></td>\r\n			<td></td>\r\n		</tr>\r\n		<tr>\r\n			<td></td>\r\n			<td></td>\r\n			<td></td>\r\n		</tr>\r\n		<tr>\r\n			<td></td>\r\n			<td></td>\r\n			<td></td>\r\n		</tr>\r\n		<tr>\r\n			<td width=\"50\"></td>\r\n			<td>\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"background-color: rgb(27, 77, 140); font-family: Arial,Helvetica,sans-serif; font-size: 14px; color: rgb(255, 255, 255); font-weight: normal; line-height: 25px;\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td align=\"center\" rowspan=\"4\"><font color=\"#000000\" face=\"Times New Roman\" size=\"3\">$logo$</font></td>\r\n									<td align=\"center\"></td>\r\n								</tr>\r\n								<tr>\r\n									<td align=\"left\" style=\"background-color: rgb(27, 77, 140); font-family: Arial,Helvetica,sans-serif; font-size: 24px; color: rgb(255, 255, 255); font-weight: bolder; line-height: 35px;\"><font color=\"#000000\" face=\"Times New Roman\" size=\"3\"><span style=\"font-weight: 400;\">Right CRM</span></font></td>\r\n								</tr>\r\n								<tr>\r\n									<td align=\"right\" style=\"padding-right: 100px;\"><font color=\"#000000\" face=\"Times New Roman\" size=\"3\">Advanced Cloud Based CRM System</font></td>\r\n								</tr>\r\n								<tr>\r\n									<td></td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n	