(NULL, 'TEST', NULL, 'TEST', '', '<!-- NAME: 1 COLUMN -->\r\n<!--[if gte mso 15]>\r\n        <xml>\r\n            <o:OfficeDocumentSettings>\r\n            <o:AllowPNG></o:AllowPNG>\r\n            <o:PixelsPerInch>96</o:PixelsPerInch>\r\n            </o:OfficeDocumentSettings>\r\n        </xml>\r\n        <![endif]-->\r\n<style type=\"text/css\">\r\n	p {\r\n		margin: 10px 0;\r\n		padding: 0;\r\n	}\r\n	\r\n	table {\r\n		border-collapse: collapse;\r\n	}\r\n	\r\n	h1,\r\n	h2,\r\n	h3,\r\n	h4,\r\n	h5,\r\n	h6 {\r\n		display: block;\r\n		margin: 0;\r\n		padding: 0;\r\n	}\r\n	\r\n	img,\r\n	a img {\r\n		border: 0;\r\n		height: auto;\r\n		outline: none;\r\n		text-decoration: none;\r\n	}\r\n	\r\n	body,\r\n	#bodyTable,\r\n	#bodyCell {\r\n		height: 100%;\r\n		margin: 0;\r\n		padding: 0;\r\n		width: 100%;\r\n	}\r\n	\r\n	.mcnPreviewText {\r\n		display: none !important;\r\n	}\r\n	\r\n	#outlook a {\r\n		padding: 0;\r\n	}\r\n	\r\n	img {\r\n		-ms-interpolation-mode: bicubic;\r\n	}\r\n	\r\n	table {\r\n		mso-table-lspace: 0pt;\r\n		mso-table-rspace: 0pt;\r\n	}\r\n	\r\n	.ReadMsgBody {\r\n		width: 100%;\r\n	}\r\n	\r\n	.ExternalClass {\r\n		width: 100%;\r\n	}\r\n	\r\n	p,\r\n	a,\r\n	li,\r\n	td,\r\n	blockquote {\r\n		mso-line-height-rule: exactly;\r\n	}\r\n	\r\n	a[href^=tel],\r\n	a[href^=sms] {\r\n		color: inherit;\r\n		cursor: default;\r\n		text-decoration: none;\r\n	}\r\n	\r\n	p,\r\n	a,\r\n	li,\r\n	td,\r\n	body,\r\n	table,\r\n	blockquote {\r\n		-ms-text-size-adjust: 100%;\r\n		-webkit-text-size-adjust: 100%;\r\n	}\r\n	\r\n	.ExternalClass,\r\n	.ExternalClass p,\r\n	.ExternalClass td,\r\n	.ExternalClass div,\r\n	.ExternalClass span,\r\n	.ExternalClass font {\r\n		line-height: 100%;\r\n	}\r\n	\r\n	a[x-apple-data-detectors] {\r\n		color: inherit !important;\r\n		text-decoration: none !important;\r\n		font-size: inherit !important;\r\n		font-family: inherit !important;\r\n		font-weight: inherit !important;\r\n		line-height: inherit !important;\r\n	}\r\n	\r\n	#bodyCell {\r\n		padding: 10px;\r\n	}\r\n	\r\n	.templateContainer {\r\n		max-width: 600px !important;\r\n	}\r\n	\r\n	a.mcnButton {\r\n		display: block;\r\n	}\r\n	\r\n	.mcnImage,\r\n	.mcnRetinaImage {\r\n		vertical-align: bottom;\r\n	}\r\n	\r\n	.mcnTextContent {\r\n		word-break: break-word;\r\n	}\r\n	\r\n	.mcnTextContent img {\r\n		height: auto !important;\r\n	}\r\n	\r\n	.mcnDividerBlock {\r\n		table-layout: fixed !important;\r\n	}\r\n	/*\r\n@tab Page\r\n@section Background Style\r\n@tip Set the background color and top border for your email. You may want to choose colors that match your company\'s branding.\r\n*/\r\n	\r\n	body,\r\n	#bodyTable {\r\n		/*@editable*/\r\n		background-color: #FAFAFA;\r\n	}\r\n	/*\r\n@tab Page\r\n@section Background Style\r\n@tip Set the background color and top border for your email. You may want to choose colors that match your company\'s branding.\r\n*/\r\n	\r\n	#bodyCell {\r\n		/*@editable*/\r\n		border-top: 0;\r\n	}\r\n	/*\r\n@tab Page\r\n@section Email Border\r\n@tip Set the border for your email.\r\n*/\r\n	\r\n	.templateContainer {\r\n		/*@editable*/\r\n		border: 0;\r\n	}\r\n	/*\r\n@tab Page\r\n@section Heading 1\r\n@tip Set the styling for all first-level headings in your emails. These should be the largest of your headings.\r\n@style heading 1\r\n*/\r\n	\r\n	h1 {\r\n		/*@editable*/\r\n		color: #202020;\r\n		/*@editable*/\r\n		font-family: Helvetica;\r\n		/*@editable*/\r\n		font-size: 26px;\r\n		/*@editable*/\r\n		font-style: normal;\r\n		/*@editable*/\r\n		font-weight: bold;\r\n		/*@editable*/\r\n		line-height: 125%;\r\n		/*@editable*/\r\n		letter-spacing: normal;\r\n		/*@editable*/\r\n		text-align: left;\r\n	}\r\n	/*\r\n@tab Page\r\n@section Heading 2\r\n@tip Set the styling for all second-level headings in your emails.\r\n@style heading 2\r\n*/\r\n	\r\n	h2 {\r\n		/*@editable*/\r\n		color: #202020;\r\n		/*@editable*/\r\n		font-family: Helvetica;\r\n		/*@editable*/\r\n		font-size: 22px;\r\n		/*@editable*/\r\n		font-style: normal;\r\n		/*@editable*/\r\n		font-weight: 