(NULL, 'Elite Carpet Cleaning Estimate', NULL, 'Elite Carpet Cleaning Estimate', 'Online Lead Email Template - Don', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\">\r\n<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body class=\"scayt-enabled\">\r\n<div>\r\n<center>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"borderGrey\" width=\"600px\">\r\n	<tbody>\r\n		<tr style=\"height:50px;\">\r\n			<td colspan=\"6\" style=\"border-top: 1px solid #ddd; font-family: Helvetica,Verdana,sans-serif\">Hi ,<br />\r\n			<br />\r\n			Thank you for your enquiry.&nbsp;<br />\r\n			<br />\r\n			We have years of experience in carpet cleaning and are confident that your carpets will be looking and smelling great in no time.<br />\r\n			<br />\r\n			Our specialised, environmentally friendly cleaning products ensure your carpets are cleaned, soft and dry in about an hour.<br />\r\n			<br />\r\n			Your Enquiry:<br />\r\n			<br />\r\n			<br />\r\n			Estimate: $<br />\r\n			<br />\r\n			Available days this week are XXXXXXX or XXXXXXXX. Please let me know by return email or phone (details below) if these suit. If not, we&rsquo;ll work something out.<br />\r\n			<br />\r\n			Did you know we also clean mattresses, rugs and upholstery? I&rsquo;m happy to help if you need them looking like new again.<br />\r\n			<br />\r\n			Look forward to hearing from you soon.<br />\r\n			<br />\r\n			Kind regards,<br />\r\n			<br />\r\n			Don Lopez<br />\r\n			<br />\r\n			Elite HQ<br />\r\n			Ph: 0431699096<br />\r\n			Email: don@elitedry.com.au<br />\r\n			<br />\r\n			Elite Carpet Dry Cleaning - Australia Wide - Phone 131 580</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"6\" style=\"font-family: Helvetica,Verdana,sans-serif;font-size: 11px;color: #666666;\">\r\n			<table border=\"0\" cellpadding=\"4\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td colspan=\"2\" id=\"social\" valign=\"middle\">\r\n						<center>\r\n						<div>&nbsp;<a href=\"\" target=\"_blank\"> follow on Twitter</a> | <a href=\"\" target=\"_blank\">follow on Facebook</a></div>\r\n						</center>\r\n						</td>\r\n					</tr>\r\n					<!--copy right data-->\r\n					<tr>\r\n						<td valign=\"top\" width=\"350px\">\r\n						<center>\r\n						<div><em>Copyright &copy; 2021 your company.com, All rights reserved.</em></div>\r\n						</center>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</center>\r\n</div>\r\n</body>\r\n</html>\r\n', 0, 18, 0, 'Leads');
