(506, 'description', NULL, '&lt;html&gt;\r\n&lt;head&gt;\r\n	&lt;title&gt;&lt;/title&gt;\r\n&lt;/head&gt;\r\n&lt;body&gt;Hi Lea-Ann,&lt;br /&gt;\r\n&lt;br /&gt;\r\nThank you for your enquiry.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nWe have years of experience in carpet cleaning and are confident that your carpets will be looking and smelling great in no time.&lt;br /&gt;\r\n&lt;br /&gt;\r\nOur specialised, environmentally friendly cleaning products ensure your carpets are cleaned, soft and dry in about an hour.&lt;br /&gt;\r\n&lt;br /&gt;\r\nYour Enquiry&lt;br /&gt;\r\nsingle bed mattress with urine stain.. price please...another mattress with water marks single&amp;nbsp; both I think are king singles&lt;br /&gt;\r\n&lt;br /&gt;\r\nEstimate: $260&lt;br /&gt;\r\n&lt;br /&gt;\r\nIf both mattress that you have are king single the cost will be $260 and that&#039;s already to clean the top and side part of the bed and for the urine stain and water marks this will be an additional cost possibly if it won&#039;t come out on the general cleaning process which we can only tell you once our technician gets to your place.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\njust to confirm: 2x King single $260&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nDid you know we also clean Carpets, rugs and upholstery? I&rsquo;m happy to help if you need them looking like new again.&lt;br /&gt;\r\n&lt;br /&gt;\r\nLook forward to hearing from you soon.&lt;br /&gt;\r\n&lt;br /&gt;\r\nKind regards,&lt;br /&gt;\r\n&lt;br /&gt;\r\nDon&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nElite HQ&lt;br /&gt;\r\nPh: 0431699096&lt;br /&gt;\r\nEmail: don@elitedry.com.au&lt;br /&gt;\r\n&lt;br /&gt;\r\nElite Carpet Dry Cleaning - Australia Wide - Phone 131 580&lt;br /&gt;\r\n&lt;/body&gt;\r\n&lt;/html&gt;\r\n'),
