(510, 'description', NULL, '&lt;html&gt;\r\n&lt;head&gt;\r\n	&lt;title&gt;&lt;/title&gt;\r\n&lt;/head&gt;\r\n&lt;body&gt;Hi Chanel,&lt;br /&gt;\r\n&lt;br /&gt;\r\nThank you for your enquiry.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nWe have years of experience in carpet cleaning and are confident that your carpets will be looking and smelling great in no time.&lt;br /&gt;\r\n&lt;br /&gt;\r\nOur specialised, environmentally friendly cleaning products ensure your carpets are cleaned, soft and dry in about an hour.&lt;br /&gt;\r\n&lt;br /&gt;\r\nYour Enquiry&lt;br /&gt;\r\nNeed a quote for cleaning 1 x Queen mattress &amp; 2 x Double mattress. Each have stains&lt;br /&gt;\r\n&lt;br /&gt;\r\nEstimate: $340&lt;br /&gt;\r\n&lt;br /&gt;\r\nThe cost to clean 1x Queen and 2x Double mattress is $340 this will cover cleaning the top and sides part of the bed, for stains that won&#039;t come out during the general cleaning process there will be an additional cost for it which we can only tell you on the day once the technician gets there and inspect your mattress and we won&#039;t do anything when it comes to the stains without your approval.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nAvailable days this week are Wednesday, Thursday and Friday. Please let me know by return email or phone (details below) if these suit. If not, we&rsquo;ll work something out.&lt;br /&gt;\r\n&lt;br /&gt;\r\nDid you know we also clean Carpets, rugs and upholstery? I&rsquo;m happy to help if you need them looking like new again.&lt;br /&gt;\r\n&lt;br /&gt;\r\nLook forward to hearing from you soon.&lt;br /&gt;\r\n&lt;br /&gt;\r\nKind regards,&lt;br /&gt;\r\n&lt;br /&gt;\r\nDon&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nElite HQ&lt;br /&gt;\r\nPh: 0431699096&lt;br /&gt;\r\nEmail: don@elitedry.com.au&lt;br /&gt;\r\n&lt;br /&gt;\r\nElite Carpet Dry Cleaning - Australia Wide - Phone 131 580&lt;br /&gt;\r\n&lt;/body&gt;\r\n&lt;/html&gt;\r\n'),
