(514, 'description', NULL, '&lt;html&gt;\r\n&lt;head&gt;\r\n	&lt;title&gt;&lt;/title&gt;\r\n&lt;/head&gt;\r\n&lt;body&gt;Hi Freya,&lt;br /&gt;\r\n&lt;br /&gt;\r\nThank you for your enquiry.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nWe have years of experience in carpet cleaning and are confident that your carpets will be looking and smelling great in no time.&lt;br /&gt;\r\n&lt;br /&gt;\r\nOur specialised, environmentally friendly cleaning products ensure your carpets are cleaned, soft and dry in about an hour.&lt;br /&gt;\r\n&lt;br /&gt;\r\nYour Enquiry&lt;br /&gt;\r\nFabric sofa that needs a clean from general use&lt;br /&gt;\r\n&lt;br /&gt;\r\nEstimate: 0&lt;br /&gt;\r\n&lt;br /&gt;\r\nMay I please know how many seaters your fabric sofa is? we price it per seating positions.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nDid you know we also clean mattresses, rugs and carpets? I&rsquo;m happy to help if you need them looking like new again.&lt;br /&gt;\r\n&lt;br /&gt;\r\nLook forward to hearing from you soon.&lt;br /&gt;\r\n&lt;br /&gt;\r\nKind regards,&lt;br /&gt;\r\n&lt;br /&gt;\r\nDon&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nElite HQ&lt;br /&gt;\r\nPh: 0431699096&lt;br /&gt;\r\nEmail: don@elitedry.com.au&lt;br /&gt;\r\n&lt;br /&gt;\r\nElite Carpet Dry Cleaning - Australia Wide - Phone 131 580&lt;br /&gt;\r\n&lt;/body&gt;\r\n&lt;/html&gt;\r\n'),
